import './App.css';
import Projects from './projects';
import Images from './Images';
import profile from './files/profile.png';
import resume from './files/Resume.pdf';
function App() {
  return (
    <div className="Wrapper" style = {{"font-family": "Roboto",
      "font-style": "normal",
      "font-weight": "normal"}}>
        <div className="GeneralInfo" style={{"border": "2px solid blue", "display":"inline-block"}}>
          <img src={profile} alt="" style={{"height" : "10%", "width" : "10%", "border-radius": "50%"}}></img>
          <div style={{"float":"right", "width":"85%"}}>
            <p style={{"font-size":"200%", "line-height":"300%"}}> Abhinandan Srinivas </p>
            <p style={{"font-size":"150%", "line-height":"50%"}}> Software Developer </p>
            <a href={resume} download> Resume </a>
          </div>
        </div>


        <div style={{"height":"40%", "width":"100%", "border":"2px solid black"}}> something </div>
        <div className="Frameworks">
          <p>Frameworks I can work with</p>
          <Images />
      </div>
      <div>
        <p> Some of my projects </p>   
      </div>
      <div>
        <Projects />
      </div>
    </div>
  );
}

export default App;
